import React from 'react';
import Task from '/List.js';
import { useEffect,useState } from 'react';

function File() {
    function data() {
        const [ntp, setntp] = useState([]);
        useEffect(() => {
            fetch("http://localhost:7654/files")
                .then((response) => response.json())
                .then((data) => setntp(data)).then(console.log(ntp));
        }, []);
    }
    return (
        <div className='tasks-list-container'>
            <div className='form'>
                <form>
                    <input className='input' placeholder='🔍 Search Files' />
                </form>
            </div>
            <div className='tasks-list'>
                {ntp.map(task => <Task key={task.key} text={task.text} id={task.id} removeTask={this.props.removeTask} />)}
            </div>
        </div>
    );
}

export default File;
